        <div className="row ">
            <div className="container">
                <div className="col-12 d-flex justify-content-center align-items-center flex-column">
                    <h1>Заказ номер {mongoObjectId()},статус: processing</h1>
                    <h2>покупатель: {props.order.formData.name}</h2>
